describe("Element Data Attributes Tests",function(){var a;it("reads the 'data-slider-min' property and sets it on slider",function(){a=$("#minSlider").slider();a.slider("setValue",1);var b=a.slider("getValue");expect(b).toBe(5)});it("reads the 'data-slider-max' property and sets it on slider",function(){a=$("#maxSlider").slider();a.slider("setValue",10);var b=a.slider("getValue");expect(b).toBe(5)});it("reads the 'data-slider-step' property and sets it on slider",function(){a=$("#stepSlider").slider();expect(true).toBeTruthy()});it("reads the 'data-slider-precision' property (which is set to 2) and sets it on slider",function(){a=$("#precisionSlider").slider();a.slider("setValue",8.115);var b=a.slider("getValue");expect(b).toBe(8.12)});it("reads the 'data-slider-orientation' property and sets it on slider",function(){a=$("#orientationSlider").slider();var b=$("#orientationSlider").parent("div.slider").hasClass("slider-vertical");expect(b).toBeTruthy()});it("reads the 'data-slider-value' property and sets it on slider",function(){a=$("#valueSlider").slider();var b=a.slider("getValue");expect(b).toBe(5)});it("reads the 'data-slider-selection' property and sets it on slider",function(){a=$("#selectionSlider").slider();a.slider("setValue",10);var b=$("#selectionSlider").siblings("div.slider-track").children("div.slider-selection").width();expect(b).toBe(0)});it("reads the 'data-slider-tooltip' property and sets it on slider",function(){a=$("#tooltipSlider").slider();var b=$("#tooltipSlider").siblings("div.tooltip").hasClass("hide");expect(b).toBeTruthy()});it("reads the 'data-slider-handle' property and sets it on slider",function(){a=$("#handleSlider").slider();var c=$("#handleSlider").siblings("div.slider-track").children("div.slider-handle").hasClass("triangle");expect(c).toBeTruthy();a=$("#customHandleSlider").slider();var b=$("#customHandleSlider").siblings("div.slider-track").children("div.slider-handle").hasClass("custom");expect(b).toBeTruthy()});it("reads the 'data-slider-reversed' property and sets it on slider",function(){a=$("#reversedSlider").slider();a.slider("setValue",10);var b=$("#reversedSlider").siblings("div.slider-track").children("div.slider-selection").width();expect(b).toBe(0)});it("reads the 'data-slider-enabled' property and sets it on slider",function(){a=$("#disabledSlider").slider();var b=a.slider("isEnabled");expect(b).not.toBeTruthy()});it("changes the 'data-slider-orientation' property from horizontal to vertical",function(){a=$("#changeOrientationSlider").slider();a.slider("setAttribute","orientation","vertical").slider("refresh");var d=$("#changeOrientationSlider").parent("div.slider");var c=d.hasClass("slider-vertical");var b=d.find(".slider-handle").last().hasClass("hide");expect(c).toBeTruthy();expect(b).toBeTruthy()});afterEach(function(){if(a){a.slider("destroy")}})});